20番手～40番手の糸で平織りされたむら染の綿布です。<br>針通しがよく縫いやすい生地なのでパッチワークに最適です。<br><br>◆サイズ（約）：34×50cm<br>◆素材：綿100%<br>◆国産<br><br>※ご購入後は早めにシールをはがし、水通しをして下さい。<br>※写真と実際の商品の色とは多少異なる場合があります。<style type="text/css">
